function windowOnload(){if(window.parent)for(var e="main-link-selected",n=window.parent.location.pathname.split("/"),i=document.getElementsByClassName("clickable-main-link"),a=0;a!=i.length;){var t=i[a].attributes.getNamedItem("href").value.split("/");if(t[1]==n[1]){i[a].classList.add(e);break}a++}}window.onload=windowOnload;